import React, { Component } from 'react'

export default class InstructorList extends Component {
    state = {
        data:[]
    }
    componentDidMount(){
        this.setState({
            data:['Micheal Owen', 'Gary Neville', 'Rio Ferdinand', 'John Terry']
        });
    }
    render() {
        return (
            <div>
                <li>this.state.data.map(val, index)</li>
            </div>
        )
    }
}
